import React from 'react';
import url from "@assets/image/SliceAccount.png"

const ListProductUserSell = () => {
    return (
        <div >
            <div className='border w-[600px] h-[150px] -translate-x-14 rounded-lg'>
                <img src={url} alt="" className='w-[100px] absolute top-[50%] -translate-y-[50%] left-5 rounded-lg' />
            </div>
            <div>
                <h1>Điện thoại Iphone 13</h1>
            </div>
        </div>
    );
};

export default ListProductUserSell;
